import back from "../components/Botton/back.vue";
import { apiGetUserInfo } from "@/api/User";
export default {
  components: {
    back
  },
  created() {
    this.getuser();
  },
  data() {
    return {
      vip: "",
      url: "",
      ShowExplain: false
    };
  },
  methods: {
    showPopup() {
      this.ShowExplain = true;
    },
    hideExplain() {
      this.ShowExplain = false;
    },
    getuser() {
      apiGetUserInfo("", true).then(res => {
        this.vip = res.RankId;
        this.url = res.UImg;
      });
    }
  }
};
